import kabaddiLogo from "../assets/webp/Indo-International-Premier-Kabaddi-League.webp"
import edzolaLogo from "../assets/1630630378720.jpeg"

export const achievementData = {
    bio : "Putting quantified achievements on a resume is great, but I just don’t work with hard numbers. I have no data to support the quality of my work. If you have lots of relevant experience, the heading statement of your resume will be a summary.",
    achievements : [
        {
            id : 1,
            title : 'Employee of the Year',
            details : 'Awarded ”Employee of the Year” by EdZola Technologies (2024) for outstanding performance and contribution.',
            date : 'Sep, 2024',
            field : 'Software Development',
            image : edzolaLogo
        },
        {
            id : 2,
            title : 'participation Kabaddi certificate',
            details : 'Received a participation certificate for representing in the 62nd National Girls’ Games (Kabaddi) (2016-2017).',
            date : 'Aug 20, 2019',
            field : 'Kabaddi',
            image : kabaddiLogo
        }

    ]
}
